import Image from "next/image";
import { memo } from "react";

const NextWidth: React.FC<{
  alt?: string;
  src?: string;
  height?: any;
  width?: any;
}> = memo(({ alt, src, height, width }) => {
  return (
    <Image
      alt={alt}
      src={src}
      placeholder="blur"
      blurDataURL={
        "data:image/jpeg;base64,"
      }
      width={width}
      height={height}
    />
  );
});

export default NextWidth;
